import React,{useEffect,useState} from 'react';
import axios from 'axios';

const Home = () => {
    const [state,setState] = useState([]);
    useEffect (()=>{
        axios.get ('http://localhost:9000/create-data')
        .then(res =>{
            console.log(res);
        })
    })
  return (
    <div>
    <ul>
    {state.map(state => <li key={state.name}>{state.job}</li>)}
    </ul>
    </div>
  )

}

export default Home;
